import React from 'react';
import { Link } from 'react-router-dom';
import { Box } from '@mui/material';

const Header = () => {
  return (
    <header>
      <Box display="flex" justifyContent="flex-start" alignItems="center" height="100%" paddingLeft="1.25rem">
        <Link to="/" style={{ textDecoration: 'underline', color: 'blue' }}>
          <span style={{ fontSize: '1.25rem', position: 'relative', top: '5rem' }}>Home</span>
        </Link>
      </Box>
    </header>
  );
};

export default Header;
